import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";
import { useState ,useEffect} from "react";
import Error from "../ErrorPage";

const BankForm = () => {
    const {placeholder} = useParams();
    const [group,setGroup] = useState();
    const groupDetails = useSelector(state => state.transfer);
    useEffect(() => {
        if(!placeholder || !groupDetails) {
            return <Error/>
        }
        setGroup(groupDetails.filter((val) => val.group === placeholder.group));
        console.log(group);
    }, [])

    // check if placeholder has data
    // map through the group to check if placeholder occurs
    return (<div>
                <Container>
                    <Typography variant="body1" color ='primary' style =  {{marginLeft: 20, marginTop:50, fontSize:20}}>Multiple Transfer</Typography>
                </Container>
    </div>);
}
export default BankForm;
